import React from 'react';
import './Rect.css';

function Rectangle() {
class Rectangle extends React.Component {
    render() {
        return (
            <div className="Rectangle">
            <div
                style={{
                    left: '700px',
                    height: '100vh',
                    width: '50vw',
                    position: 'relative'
                }}>
                <button
                    style={{
                        marginTop: '160px'
                    }}
                    onClick={() => alert('Button clicked')}>
                    click
                </button>
            </div>
            </div>
            );
        }
    }
}
export default Rectangle
